import React from 'react';
import '../App.css';
import { Button } from './Button';
import './AvgLibor.css';

function AvgLiborSection() {
  return (
    <div className='avglibor-container'>
      <div className='avglibor-project-container'>


<h3>Average Libor Estimator (First released March 2020)</h3>

<br />
<img src='images/Libor.jpeg'/>
<br />
<p><b>Summary</b> : This website allows user to select a start and end date to estimate Average One Month US Libor and Cost of Carry.  Developed using Python, Django, PostgreSQL and launched using Heroku.
</p>
<br />
<a href="https://avglibor.herokuapp.com/estimator/">https://avglibor.herokuapp.com/estimator/</a>
    </div>
      </div>
  );
}

export default AvgLiborSection;
